import React, { useState } from "react";
import User from "../../components/user/user";
import styles from "../../page/shoppingPage/ShoppingPage.module.css";
import data from "../../FakeData/data.json";
import Robot from "../../components/robotbox/Robot.1";
import logo from "../../assets/images/logo.svg";
import { Goods, CartItem } from "../../App";

const ShoppingPage: React.FC = () => {
  const [addToCart, setAddToCart] = useState<CartItem[]>();

  return (
    <div>
      <User />
      <div className={styles.appHeader}>
        <img className={styles.appLogo} src={logo} alt="logo"></img>
        <h1>robot supermarket</h1>
      </div>
      <div className={styles.robotList}>
        {data.map((h) => (
          <Robot id={h.id} email={h.email} name={h.name} />
        ))}
      </div>
    </div>
  );
};

export default ShoppingPage;
